// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./libraries/Pb.sol";
import "./libraries/PbHeader.sol";
import "./libraries/merkle.sol";

contract BHVF {
    using Pb for Pb.Buffer; // so we can call Pb funcs on Buffer obj

    function getBlockHash(bytes memory raw) public pure returns (bytes32) {
        if (raw.length == 0) {
            return bytes32(0);
        }

        bytes[] memory leaves = new bytes[](14);
        Pb.Buffer memory buf = Pb.fromBytes(raw);

        uint256 tag;
        Pb.WireType wire;
        while (buf.hasMore()) {
            (tag, wire) = buf.decKey();
            leaves[tag - 1] = buf.decBytes();
        }
        return Merkle.hashFromByteSlices(leaves);
    }
}

